tables.table_schema:
CREATE TABLE parking_spaces (
	parking_space_id INT PRIMARY KEY,
	location VARCHAR(100),
	available BOOLEAN
);

CREATE TABLE parking_lot (
    parking_lot_id UUID PRIMARY KEY,
    location VARCHAR(255),
    capacity INT,
    available_spots INT
);

CREATE TABLE parking_history (
    parking_history_id SERIAL PRIMARY KEY,
    parking_lot_id UUID,
    timestamp TIMESTAMP,
    is_reserved BOOLEAN
);

CREATE TABLE parking_cost (
    parking_cost_id SERIAL PRIMARY KEY,
    parking_lot_id UUID,
    cost_per_hour DECIMAL(10, 2),
    currency VARCHAR(3)
);

CREATE TABLE parking_lot (
    parking_spot_id INT PRIMARY KEY,
    spot_location VARCHAR(255) NOT NULL,
    availability BOOLEAN
);

CREATE TABLE parking_history (
    history_id INT PRIMARY KEY,
    parking_spot_id INT,
    date_time DATETIME,
    status VARCHAR(50)
);

CREATE TABLE parking_rates (
    rate_id INT PRIMARY KEY,
    parking_spot_id INT,
    rate DECIMAL(10, 2),
    currency VARCHAR(3)
);

CREATE TABLE user_parking_preferences (
    user_id INT PRIMARY KEY,
    preferred_location VARCHAR(255),
    max_distance DECIMAL(10, 2),
    notify BOOLEAN
);
